import React from 'react'
import {Carrouseldata} from '../components/Carrouseldata'
import Slider from "../components/Slider"
import Footer from "../components/Footer"
function Home() {
    return (
        <div className='home'>
            <Slider slides={Carrouseldata}/>
        </div>
    )
}

export default Home
